 @Elizabeth Lafleur  Dark skin and hair is an adaptation for survival in areas with high UV light exposure.    Even like 1m of water attenuates like 60% of UV light - so if there ever were a race of humanoid aquatic beings like Mermaids, none of them would EVER be dark skinned, regardless of which particular body of water in the world they lived in.   

Iirc gingers are the genotype which has the least eumelanin - so they're essentially as 'white as white gets' - and it makes sense if you were to draw a single quintessential mermaid, it would therefore be a redhead, due to the link between uv and eumelanin level.   Which is probably why Disney did it that way to begin with.

Obviously I'm aware Mermaids are an absurd concept on their own... but a dark skinned mermaid is even more absurd.

