 @ChaoticAngelKitten  Did I get that right?  You call yourself a "researcher" but didn't even bother reading the source material of the story you're making claims about?  

If you did any research on the actual story written by Hans Christian Andersen, you'd know it was based on a mix of his personal experience of unrequited love for a straight man and the German story Undine, which is about a version of a mermaid from French  folklore called a melusine .  

Argue about Disney's version all you want, that's not my issue, but there is literally no evidence HCA was even influenced by Greek myth in his writing of it, let alone based it on it.  Not to mention there are fundamental differences between something being "based on" or "influenced by" something else, which you don't seem to differentiate between.

